                                const date = new Date(data[i].datetime.replace(" ", "T"));

                        const yAxis = d3.axisLeft(y);

                            .attr("width", x.bandwidth())
                            .attr("fill", d => d.open > d.close ? "red" : "green");

                        const smaLine = d3.line()

                                    const timeStr = dt.toTimeString().slice(0, 5); // "HH:MM"

                                    const isInSession = (
                                        (start < end && timeStr >= start && timeStr < end) ||
                                        (start > end && (timeStr >= start || timeStr < end)) //  
                                    );

                                }).filter(i => i !== null);

                                .attr("y2", yExit)

                                .attr("stroke-width", 2)
                                .attr("stroke-dasharray", "4 2");

                            //     (LONG / SHORT)

                                .style("font-size", "12px")
                                .style("font-weight", "bold")
                                .text(trade.direction);

                            //  RR-,   SL  TP 
                            if (hasSL && hasTP) {
                            const rr = (Math.abs(takeProfit - entryPrice) / Math.abs(entryPrice - stopLoss)).toFixed(2);
                                const rrLabel = `1 : ${parseFloat(rr)}`;
                                const centerY = (yTop + yBottom) / 2;

                                g.append("text")
                                    .attr("x", xStart + rectWidth / 2)
                                    .attr("y", centerY)
                                    .attr("text-anchor", "middle")
                                    .attr("alignment-baseline", "middle")
                                    .attr("fill", "black")
                                    .style("font-size", "14px")
                                    .style("font-weight", "bold")
                                    .text(rrLabel);
                            }

                            // =====================================================
                            //    ( )   
                            // =====================================================

                            //   ENTRY
                            g.append("line")
                                .attr("x1", xStart)
                                .attr("x2", xEnd)

                                .attr("stroke-width", 1)
                                .attr("stroke-dasharray", "3 3")
                                .attr("opacity", 0.7);

                            //   TAKE PROFIT
                            if (hasTP) {
                                g.append("line")
                                    .attr("x1", xStart)
                                    .attr("x2", xEnd)
                                    .attr("y1", y(trade.takeProfit))
                                    .attr("y2", y(trade.takeProfit))
                                    .attr("stroke", "green")
                                    .attr("stroke-width", 1)
                                    .attr("stroke-dasharray", "6 3")
                                    .attr("opacity", 0.6);
                            }

                            //   STOP LOSS
                            if (hasSL) {
                                g.append("line")
                                    .attr("x1", xStart)
                                    .attr("x2", xEnd)
                                    .attr("y1", y(trade.stopLoss))
                                    .attr("y2", y(trade.stopLoss))
                                    .attr("stroke", "red")
                                    .attr("stroke-width", 1)
                                    .attr("stroke-dasharray", "6 3")
                                    .attr("opacity", 0.6);
                            }
                        });
